t. Click on the button below to login or register for FREE using your %1$sGoogle account, Facebook account%2$s or %1$syour email account%2$s.'=>'Plugin hiện không được kết nối với tài khoản Rank Math của bạn. Nhấp vào nút bên dưới để đăng nhập hoặc đăng ký MIỄN PHÍ bằng tài khoản %1$sGoogle, tài khoản Facebook%2$s hoặc tài khoản %1$semail%2$s của bạn.','The price range of the business, for example $$$.'=>'Phạm vi giá của doanh nghiệp, ví dụ: $$$.','The process may take a few minutes if you have a large number of posts or pages <a href="%2$s" target="_blank">Learn more about the import process here.</a>'=>'Quá trình có thể mất vài phút nếu bạn có một lượng lớn bài viết hoặc trang <a href="%2$s" target="_blank">Tìm hiểu thêm về quy trình nhập ở đây.</a>','The prompt data to be saved in the database.'=>'Dữ liệu lời nhắc cần được lưu trong cơ sở dữ liệu.','The redirection you are trying to create may cause an infinite loop. Please check the source and destination URLs. The redirection has been deactivated.'=>'Chuyển hướng bạn đang cố gắng tạo có thể gây ra vòng lặp vô hạn. Vui lòng kiểm tra URL nguồn và URL đích. Chuyển hướng đã bị hủy kích hoạt.','The redirection you are trying to update may cause an infinite loop. Please check the source and destination URLs.'=>'Chuyển hướng bạn đang cố gắng cập nhật có thể gây ra vòng lặp vô hạn. Vui lòng kiểm tra URL nguồn và URL đích.','The request was invalid.'=>'Yêu cầu không hợp lệ.','The selected prompt to be updated in the recent prompts.'=>'Lời nhắc đã chọn cần được cập nhật trong các lời nhắc gần đây.','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'Cấu trúc liên kết cố định tiêu chuẩn khá xấu xí - WordPress tạo ra các URL khó chịu như: http://www.yoursite.com/?p=99','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'Khẩu hiệu là lựa chọn thứ 