ectively.'=>'Sơ đồ trang web XML giúp các công cụ tìm kiếm lập chỉ mục nội dung trang web của bạn hiệu quả hơn.','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'Sơ đồ trang web XML là một loại tệp văn bản đặc biệt cho các công cụ tìm kiếm biết về cấu trúc trang web của bạn. Chúng là danh sách tất cả các tài nguyên (trang và tệp) mà bạn muốn công cụ tìm kiếm lập chỉ mục. Bạn có thể gán các mức độ ưu tiên khác nhau, vì vậy một số trang nhất định sẽ được thu thập dữ liệu trước. Trước sơ đồ trang web XML, các công cụ tìm kiếm chỉ giới hạn trong việc lập chỉ mục nội dung mà họ có thể tìm thấy bằng cách theo dõi các liên kết. Đó vẫn là một tính năng quan trọng đối với bot công cụ tìm kiếm, nhưng sơ đồ trang web XML đã giúp người tạo nội dung và công cụ tìm kiếm dễ dàng cộng tác hơn.','Yandex Verification ID'=>'ID xác minh Yandex','Yandex.Webmaster Page'=>'Trang Yandex.Webmaster','Yes, I want better SEO'=>'Có, tôi muốn SEO tốt hơn','Yes, I want to learn more'=>'Có, tôi muốn tìm hiểu thêm','Yes, you deserve it'=>'Vâng, bạn xứng đáng với nó','Yoast Block Converter'=>'Bộ chuyển đổi khối Yoast','You are about to delete all the previously imported data.'=>'Bạn sắp xóa tất cả dữ liệu đã nhập trước đó.','You are about to delete your 90 days cache.'=>'Bạn sắp xóa bộ nhớ cache 90 ngày của mình.','You are not allowed to deactivate this plugin: %s.'=>'Bạn không được phép hủy kích hoạt plugin này: %s.','You are not authorized to perform this action.'=>'Bạn không được phép thực hiện hành động nà